export const priceTag = [
    {
        name: "Duới 1 triệu",
        value: ["0", "1.000.000"],
        index: 0
    },
    {
        name: "1 triệu - 10 triệu",
        value: ["1.000.000", '10.000.000'],
        index: 1
    },
    {
        name: "10 triệu - 20 triệu",
        value: ["10.000.000", "20.000.000"],
        index: 2
    },
    {
        name: "20 triệu - 40 triệu",
        value: ["20.000.000", "40.000.000"],
        index: 3
    },
    {
        name: "Trên 40 triệu",
        value: ["40.000.000", "1.000.000.000"],
        index: 4
    },
]
